import React, { useState,useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import MainNav from "../components/MainNav";
import Builder from "./Images/builder.png";
import "./css/Signup.css";
import Axios from "axios";
import HomeNav from "../components/HomeNav";
import {toast} from "react-toastify"
import {store}from "../App.js" 

function Signup() {
  const navigate = useNavigate();
  const {otpdetails,setOtpDetails}=useContext(store);
  const [user, setUser] = useState({
    firstName: "",
    lastName: "",
    email: "",
    phone: "",
    address: "",
    city: "",
    state: "",
    pincode: "",
    password: "",
    confirmPassword: "",
  });
  const [firstNameMsg, setFirstNameMsg] = useState("");
  const [lastNameMsg, setLastNameMsg] = useState("");
  const [emailMsg, setEmailMsg] = useState("");
  const [phoneMsg, setPhoneMsg] = useState("");
  const [addressMsg, setAddressMsg] = useState("");
  const [cityMsg, setCityMsg] = useState("");
  const [stateMsg, setStateMsg] = useState("");
  const [pincodeMsg, setPincodeMsg] = useState("");
  const [passwordMsg, setPasswordMsg] = useState("");
  const [confirmPasswordMsg, setConfirmPasswordMsg] = useState("");


  const handleInputs = (e) => {
    let name = e.target.name;
    let value = e.target.value;
    setUser({ ...user, [name]: value });
  };

  const submitHandler =async (e) => {
    e.preventDefault();

    const {
      firstName,
      lastName,
      email,
      phone,
      address,
      city,
      state,
      pincode,
      password,
      confirmPassword,
    } = user;
    if (firstName === "") {
      setFirstNameMsg("First name is required!");
    } else if (lastName === "") {
      setLastNameMsg("Last name is required!");
    } else if (email === "" || !email.includes("@")) {
      setEmailMsg("Enter valid email!");
    } else if (phone === "" || phone.length !== 10) {
      setPhoneMsg("Enter valid phone number!");
    } else if (state === "") {
      setStateMsg("State is required!");
    } else if (pincode === "" || pincode.length !== 6) {
      setPincodeMsg("Enter valid pincode!");
    } else if (password === "" || password.length < 5) {
      setPasswordMsg("Pwd should be atleast 5 chars long!");
    } else if (confirmPassword === "" || confirmPassword !== password) {
      setConfirmPasswordMsg("Password doesn't match!");
    } else {

      setOtpDetails(user);

      await Axios.get(`https://ays-backend.vercel.app/checkemail?email=${user.email}`).then((res) => {

        if (res.data.length === 0) {
          navigate("/checkotp");
        } else {
          toast.error("Email already exists!",{position: toast.POSITION.BOTTOM_RIGHT})
        }
      });
    }
  };

  return (
    <>
      <MainNav />
      <img style={{ height: "650px" }} src="./indeximage.jpg" />
      <form className="form_s" onSubmit={submitHandler}>

        {/* <div style={{marginTop:"40px"}}></div> */}
        <h3 style={{marginTop:"-29px"}}>Register Here</h3>

        <div className="flex-container">
          <div class="input__box inline_1 flex-child">
            <p className="name">First Name</p>
            <input
              className="input_s"
              required="required"
              type="text"
              name="firstName"
              aria-describedby="emailHelp"
              placeholder="john etc.."
              onChange={(e) => {
                setFirstNameMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{firstNameMsg}</p>
          </div>


          <div class="input__box inline_1 flex-child">
            <p className="name"> Last Name</p>
            <input
              type="text"
              name="lastName"
              className="input_s"
              required="required"
              aria-describedby="emailHelp"
              placeholder="doe"
              onChange={(e) => {
                setLastNameMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{lastNameMsg}</p>
          </div>

        </div>

        <div className="flex-container">
          <div class="input__box inline_1 flex-child">
            <p className="name">Email</p>

            <input
              type="email"
              name="email"
              required="required"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="john@gmail.com"
              onChange={(e) => {
                setEmailMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{emailMsg}</p>
          </div>

          <div class="input__box inline_1 flex-child magenta">
            <p className="name"> Phone</p>

            <input
              type="text"
              required="required"
              name="phone"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="9014690041"
              // value={user.phone}
              onChange={(e) => {
                setPhoneMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{phoneMsg}</p>
          </div>

        </div>
        <div className="flex-container">


          <div class="input__box inline_1 flex-child">
            <p className="name">Address</p>

            <input
              type="text"
              name="address"
              required="required"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="old street"
              onChange={(e) => {
                setAddressMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{addressMsg}</p>
          </div>

          <div class="input__box inline_1 flex-child magenta">
            <p className="name">City</p>

            <input
              type="text"
              name="city"
              required="required"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="Chennai"
              // value={user.phone}
              onChange={(e) => {
                setCityMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{cityMsg}</p>
          </div>

        </div>
        <div className="flex-container">

          <div class="input__box inline_1 flex-child">
            <p className="name">State</p>
            <input
              type="text"
              required="required"
              name="state"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="State"
              // value={user.state}
              onChange={(e) => {
                setStateMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{stateMsg}</p>
          </div>

          <div class="input__box inline_1 flex-child">
            <p className="name">  Pincode</p>

            <input
              type="number"
              name="pincode"
              className="input_s"
              required="required"
              aria-describedby="emailHelp"
              placeholder="500001"
              // value={user.pincode}
              onChange={(e) => {
                setPincodeMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{pincodeMsg}</p>
          </div>

        </div>

        <div className="flex-container">

          <div class="input__box inline_1 flex-child">

            <p className="name">               Password</p>

            <input
              type="password"
              name="password"
              required="required"
              className="input_s"
              aria-describedby="emailHelp"
              placeholder="****"
              // value={user.password}
              onChange={(e) => {
                setPasswordMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{passwordMsg}</p>
          </div>

          <div class="input__box inline_1 flex-child">

            <p className="name"> Confirm Password</p>

            <input
              type="password"
              required="required"
              name="confirmPassword"
              className="input_s"

              aria-describedby="emailHelp"
              placeholder="****"
              // value={user.confirmPassword}
              onChange={(e) => {
                setConfirmPasswordMsg("");
                handleInputs(e);
              }}
            />
            <p style={{ color: "red" }}>{confirmPasswordMsg}</p>
          </div>

        </div>

        <button class="button_s">
          Register
        </button>
      </form>
    </>
  );
}

export default Signup;
